import React from "react";
import {Routes, Route, Link} from "react-router-dom";

//함수형 컴포넌트
function Body() {
    return (
    <div class="body">Body 입니다.
        <nav>
            <Link to="/Register">회원가입</Link>
            <Link to="/Login">로그인</Link>
        </nav>
    </div>
    );
}

export default Body;
